# Pyatiletka, Republic of Dagestan

}}
Pyatiletka () is a rural locality (a selo) in Kosteksky Selsoviet, Khasavyurtovsky District, Republic of Dagestan, Russia.  There are 21 streets.
Geography
Pyatiletka is located 39&nbsp;km northeast of Khasavyurt (the district's administrative centre) by road. Akaro is the nearest rural locality.
